body {
  font-family: "Gloria Hallelujah", cursive;
  /* background: linear-gradient(0.25turn, #3f87a6, #ebf8e1, #f69d3c); */
  background: linear-gradient(0.25turn, #f2bed1, #fdcedf, #f8e8ee, #f9f5f6);
}
.button-container {
  text-align: center;
}
.button {
  cursor: pointer;
  visibility: hidden;
}

.winner {
  display: hidden;
}

h1 {
  text-align: center;
}
.game-container {
  /* display: flex;

  align-items: center; */

  justify-content: center;
  display: grid;
  grid-template-columns: 80px 80px 80px;
  gap: 20px;
}
.box {
  background-color: #f2bed1;
  text-align: center;

  width: 75px;
  height: 75px;

  font-weight: 800;
  font-size: 50px;
  box-shadow: 5px 5px 5px rgb(0, 0, 0);
  cursor: pointer;
}

.input {
  padding: 10px 20px;
  font-size: 15px;
  font-weight: bold;
  text-align: center;
}
.input:hover {
  outline: none;
}
.round {
  transition: 0.3s ease;
  border: none;
  border-radius: 30px;
}
.roundA {
  background: linear-gradient(0.25turn, #f2bed1, #f9f5f6);
  box-shadow: 5px 5px 5px rgb(0, 0, 0);
  /* box-shadow: inset 0 0 30px gray; */
}
.roundA:hover {
  box-shadow: inset 0 0 10px rgb(0, 0, 0);
  color: rgb(0, 0, 0);
  background-color: rgb(188, 247, 255);
}
